        <script type = "text/javascript">
            function displayNextImage() {
                x = (x === images.length - 1) ? 0 : x + 1;
                document.getElementById("img").src = images[x];
            }
  
            function displayPreviousImage() {
                x = (x <= 0) ? images.length - 1 : x - 1;
                document.getElementById("img").src = images[x];
            }
  
            function startTimer() {
                setInterval(displayNextImage, 3000);
            }
  
            var images = [], x = -1;
            images[0] = "leaf.jpg";
            images[1] = "girl.jpg";
            images[2] = "eye.jpg";
        </script>
        <script>
            var maxCols = 6;
            var maxRows = 6;

            function CreateGrid() 
            {
	            var innerHTMLString = "";
	            innerHTMLString = '<table>';
	            for (var theRow = 1; theRow <= maxRows; theRow++)
                 {
		            innerHTMLString += '<tr>';0
		            for (var theCol = 1; theCol <= maxCols; theCol++) 
                    {
			            innerHTMLString += '<td id=\"r';
			            innerHTMLString += theRow;
			            innerHTMLString += 'c';
			            innerHTMLString += theCol;
			            innerHTMLString += '\"></td>';
		            }
		            innerHTMLString += '</tr>';
	            }
	            innerHTMLString += '</table>';
	            $('#maze-grid').html(innerHTMLString);
            }
            $(document).ready(function () { CreateGrid(); });
        </script>
